import './BtnRegister.css';
import { IoIosPerson } from 'react-icons/io';

// Button Register 
export default function ReturnBtnRegister() {
 return (
  <div className='wrp-btn-register-dash'>
   <button className='Btn'>
    <span>
     Ajouter Client
   </span>
    <IoIosPerson size={'1.5em'} color='grey' />
   </button>
   <div></div>
  </div>
 );
};
